// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title VerifiedTradingEngine
 * @notice Enhanced contract that tracks BOTH verification AND execution of AI trading signals
 * @dev Dual-tracking system: logs AI decisions + marks executions separately
 */
contract VerifiedTradingEngine {

    // Structs
    struct TradingDecision {
        string symbol;           // Trading pair (e.g., "BTC/USD")
        string recommendation;   // LONG, SHORT, HOLD, or UNVERIFIED
        uint256 confidence;      // Confidence percentage (0-100)
        bytes32 inputHash;       // Hash of AI's declared inputs
        bytes32 fdcProofHash;    // FDC verification proof hash
        bool verified;           // Whether FTSO + FDC verification passed
        bool executed;           // Whether trade was actually executed
        uint256 timestamp;       // When decision was made
        address user;            // Who triggered the decision
    }

    // State variables
    mapping(bytes32 => TradingDecision) public decisions;
    mapping(string => uint256) public verifiedCount;      // Verified decisions per symbol
    mapping(string => uint256) public unverifiedCount;    // Unverified decisions per symbol
    mapping(string => uint256) public executedCount;      // Executed trades per symbol
    mapping(address => uint256) public userDecisionCount; // Decisions per user

    uint256 public totalDecisions;

    // Events
    event DecisionVerified(
        bytes32 indexed decisionId,
        address indexed user,
        string symbol,
        string recommendation,
        bytes32 inputHash,
        bytes32 fdcProofHash,
        bool verified,
        uint256 confidence,
        uint256 timestamp
    );

    event TradingExecuted(
        bytes32 indexed decisionId,
        string symbol,
        string recommendation,
        uint256 timestamp
    );

    /**
     * @notice Log an AI trading decision with verification status
     * @param symbol Trading pair symbol
     * @param recommendation Trading signal (LONG/SHORT/HOLD/UNVERIFIED)
     * @param confidence Confidence level (0-100)
     * @param inputHash Hash of declared AI inputs
     * @param fdcProofHash FDC proof hash (empty if unverified)
     * @param verified Whether Truth Engine verified the inputs
     * @return decisionId Unique ID for this decision
     */
    function logVerifiedDecision(
        string memory symbol,
        string memory recommendation,
        uint256 confidence,
        bytes32 inputHash,
        bytes32 fdcProofHash,
        bool verified
    ) public returns (bytes32 decisionId) {

        // Generate unique decision ID
        decisionId = keccak256(abi.encodePacked(
            msg.sender,
            symbol,
            recommendation,
            inputHash,
            block.timestamp
        ));

        // Store decision
        decisions[decisionId] = TradingDecision({
            symbol: symbol,
            recommendation: recommendation,
            confidence: confidence,
            inputHash: inputHash,
            fdcProofHash: fdcProofHash,
            verified: verified,
            executed: false,
            timestamp: block.timestamp,
            user: msg.sender
        });

        // Update counters
        totalDecisions++;
        userDecisionCount[msg.sender]++;

        if (verified) {
            verifiedCount[symbol]++;
        } else {
            unverifiedCount[symbol]++;
        }

        // Emit event
        emit DecisionVerified(
            decisionId,
            msg.sender,
            symbol,
            recommendation,
            inputHash,
            fdcProofHash,
            verified,
            confidence,
            block.timestamp
        );

        return decisionId;
    }

    /**
     * @notice Mark a verified decision as executed
     * @param decisionId The decision ID to mark as executed
     */
    function markExecuted(bytes32 decisionId) public {
        TradingDecision storage decision = decisions[decisionId];

        require(decision.timestamp > 0, "Decision does not exist");
        require(decision.verified, "Cannot execute unverified decision");
        require(!decision.executed, "Decision already executed");

        decision.executed = true;
        executedCount[decision.symbol]++;

        emit TradingExecuted(
            decisionId,
            decision.symbol,
            decision.recommendation,
            block.timestamp
        );
    }

    /**
     * @notice Get decision details
     * @param decisionId Decision ID to query
     * @return Decision struct
     */
    function getDecision(bytes32 decisionId) 
        external 
        view 
        returns (TradingDecision memory) 
    {
        return decisions[decisionId];
    }

    /**
     * @notice Get statistics for a specific symbol
     * @param symbol Trading pair symbol
     * @return verified Number of verified decisions
     * @return unverified Number of unverified decisions
     * @return executed Number of executed trades
     */
    function getStats(string memory symbol) 
        public 
        view 
        returns (uint256 verified, uint256 unverified, uint256 executed) 
    {
        return (
            verifiedCount[symbol],
            unverifiedCount[symbol],
            executedCount[symbol]
        );
    }

    /**
     * @notice Get overall platform statistics
     * @return total Total decisions logged
     * @return totalVerified Total verified decisions
     * @return totalUnverified Total unverified decisions
     * @return totalExecuted Total executed trades
     * @return verificationRate Verification success rate (basis points)
     */
    function getOverallStats() 
        external 
        view 
        returns (
            uint256 total,
            uint256 totalVerified,
            uint256 totalUnverified,
            uint256 totalExecuted,
            uint256 verificationRate
        ) 
    {
        total = totalDecisions;

        // Sum up all counts
        // Note: In production, track these as state variables for gas efficiency
        totalVerified = 0;
        totalUnverified = 0;

        if (total > 0) {
            // Simplified calculation - in production, maintain running totals
            verificationRate = 0; // TODO: Calculate from tracked totals
        }

        return (total, totalVerified, totalUnverified, totalExecuted, verificationRate);
    }

    /**
     * @notice Check if a decision is verified and safe to execute
     * @param decisionId Decision ID to check
     * @return canExecute True if verified and not yet executed
     */
    function canExecuteTrade(bytes32 decisionId) external view returns (bool canExecute) {
        TradingDecision memory decision = decisions[decisionId];
        return decision.verified && !decision.executed && decision.timestamp > 0;
    }
}

